,INTL_LABEL_USED_TO_LIMIT_THE_SIZE_OF_THE_CACHE_CONTAINS_THE:"K\u00e4ytet\u00e4\u00e4n v\u00e4limuistin koon rajoitukseen. Ilmoittaa v\u00e4limuistiin sijoitettavien yksik\u00f6iden enimm\u00e4ism\u00e4\u00e4r\u00e4n ennen karsintaa. T\u00e4t\u00e4 kentt\u00e4\u00e4 ei saa j\u00e4tt\u00e4\u00e4 tyhj\u00e4ksi.",INTL_LABEL_SPECIFIES_THE_TYPE_OF_CACHE_UNIT_CALCULATOR_TO_USE_A:"M\u00e4\u00e4ritt\u00e4\u00e4 k\u00e4ytett\u00e4v\u00e4n v\u00e4limuistin yksikk\u00f6laskimen tyypin. V\u00e4limuistin yksikk\u00f6laskinta k\u00e4ytet\u00e4\u00e4n m\u00e4\u00e4ritt\u00e4m\u00e4n tietyn kohteen kustannus (yksikk\u00f6in\u00e4). T\u00e4t\u00e4 kentt\u00e4\u00e4 ei saa j\u00e4tt\u00e4\u00e4 tyhj\u00e4ksi.",INTL_LABEL_THE_CACHE_UNIT_FACTOR_SPECIFIES_THE_FACTOR_BY_WHICH_THE:"V\u00e4limuistin yksikk\u00f6kerrointa k\u00e4ytet\u00e4\u00e4n yksik\u00f6iden, pienyksik\u00f6iden ja suuryksik\u00f6iden sovitukseen. K\u00e4ytett\u00e4ess\u00e4 esim. v\u00e4limuistin yksikk\u00f6laskinta voidaan k\u00e4ytt\u00e4\u00e4 kerrointa 1048576 megatavujen laskemiseksi tavujen sijaan. T\u00e4t\u00e4 kentt\u00e4\u00e4 ei saa j\u00e4tt\u00e4\u00e4 tyhj\u00e4ksi.",INTL_LABEL_SPECIFIES_THE_AMOUNT_OF_TIME_FROM_LAST_UPDATE_THAT_ENTRIES:"M\u00e4\u00e4ritt\u00e4\u00e4, kuinka kauan viimeisen p\u00e4ivityksen j\u00e4lkeen kirjauksia s\u00e4ilytet\u00e4\u00e4n v\u00e4limuistissa ennen niiden vanhentuneiksi merkitsemist\u00e4. T\u00e4t\u00e4 kentt\u00e4\u00e4 ei saa j\u00e4tt\u00e4\u00e4 tyhj\u00e4ksi.",INTL_LABEL_SPECIFIES_THE_NAME_OF_THE_SERVICE_THIS_FIELD_MUST_NOT:"M\u00e4\u00e4ritt\u00e4\u00e4 palvelun nimen. T\u00e4t\u00e4 kentt\u00e4\u00e4 ei saa j\u00e4tt\u00e4\u00e4 tyhj\u00e4ksi.",INTL_LABEL_SPECIFIES_THE_MAXIMUM_NUMBER_OF_DAEMON_THREADS_USAGE_OF_DAEMON:'M\u00e4\u00e4ritt\u00e4\u00e4 demonis\u00e4ikeiden enimm\u00e4ism\u00e4\u00e4r\u00e4n. Demonis\u00e4ikeiden k\u00e4ytt\u00f6 vaihtelee eri palvelutyypeiss\u00e4. Jos arvo on nolla tai negatiivinen, palvelu ei k\u00e4yt\u00e4 demonis\u00e4ikeit\u00e4, ja kaikki olennaiset teht\u00e4v\u00e4t suoritetaan palvelus\u00e4ikeess\u00e4. Jos arvo on negatiivinen, teht\u00e4v\u00e4t my\u00f6s suoritetaan mahdollisuuksien mukaan kutsujan s\u00e4ikeess\u00e4. Sallittuja arvoja ovat kokonaisluvut, jotka ovat suurempia tai yht\u00e4 suuria kuin "thread-count-min"-elementin arvo. T\u00e4t\u00e4 kentt\u00e4\u00e4 ei saa j\u00e4tt\u00e4\u00e4 tyhj\u00e4ksi.',INTL_LABEL_SPECIFIES_THE_MINIMUM_NUMBER_OF_DAEMON_THREADS_USAGE_OF_DAEMON:'M\u00e4\u00e4ritt\u00e4\u00e4 demonis\u00e4ikeiden v\u00e4himm\u00e4ism\u00e4\u00e4r\u00e4n. Demonis\u00e4ikeiden k\u00e4ytt\u00f6 vaihtelee eri palvelutyypeiss\u00e4. Jos arvo on nolla tai negatiivinen, palvelu ei k\u00e4yt\u00e4 demonis\u00e4ikeit\u00e4, ja kaikki olennaiset teht\u00e4v\u00e4t suoritetaan palvelus\u00e4ikeess\u00e4. Jos arvo on negatiivinen, teht\u00e4v\u00e4t my\u00f6s suoritetaan mahdollisuuksien mukaan kutsujan s\u00e4ikeess\u00e4. Sallittuja arvoja ovat kokonaisluvut, jotka ovat pienempi\u00e4 tai yht\u00e4 suuria kuin "thread-count-max"-elementin arvo. T\u00e4t\u00e4 kentt\u00e4\u00e4 ei saa j\u00e4tt\u00e4\u00e4 tyhj\u00e4ksi.',INTL_LABEL_TICK_THIS_FIELD_TO_ENABLE_CACHE_SERVICE_PROXY_IF_DISABLED:"Valitse t\u00e4m\u00e4 kentt\u00e4 ottaaksesi v\u00e4limuistipalvelun v\u00e4lityspalvelimen k\u00e4ytt\u00f6\u00f6n. Jos t\u00e4m\u00e4 kentt\u00e4 ei ole k\u00e4yt\u00f6ss\u00e4, asiakkaat eiv\u00e4t voi k\u00e4ytt\u00e4\u00e4 v\u00e4limuisteja v\u00e4lityspalvelimen kautta.",INTL_LABEL_TICK_THIS_FIELD_TO_AUTOMATICALLY_START_THIS_SERVICE_AT_A:"Valitse t\u00e4m\u00e4 kentt\u00e4 k\u00e4ynnist\u00e4\u00e4ksesi palvelun automaattisesti ryhm\u00e4n solmussa.",INTL_LABEL_GATEWAY_AUTHORIZATION_TOKEN:"Yhdysk\u00e4yt\u00e4v\u00e4n valtuutustunnus.",INTL_LABEL_PROVIDE_ENTERPRISE_CACHE_SERVER_AGENT_NODE_NAME_THIS_FIELD_MUST:"M\u00e4\u00e4rit\u00e4 Enterprise-v\u00e4limuistipalvelimen agentin solmun nimi. T\u00e4t\u00e4 kentt\u00e4\u00e4 ei saa j\u00e4tt\u00e4\u00e4 tyhj\u00e4ksi.",INTL_LABEL